function handle(state, action) {
    const counter = state.counter;
    if (action.fn === "increment") {
        state.counter = state.counter + 1;
    }
    else {
        state.counter = state.counter - 1;
    }
    return { state };
}

'use strict';
function updateData(state, action) {
  const input = action.input;
  state.decay;
  const caller = action.caller;
  ContractAssert(input.data, `No data provided.`);
  const balances = state.balances;
  ContractAssert(
    caller in balances && balances[caller] >= 1,
    `Caller is not authorized`
  );
  state.data = input.data;
  // TODO = add sanitization!
  return { state };
}
function updateStyle(state, action) {
  const input = action.input;
  state.decay;
  const caller = action.caller;
  ContractAssert(input.style, `No style string provided.`);
  const balances = state.balances;
  ContractAssert(
    caller in balances && balances[caller] >= 1,
    `Caller is not authorized`
  );
  state.style = input.style;
  // TODO = add sanitization!
  return { state };
}
